import os, re

def decomClass(jar):
    try:
        os.popen('jar xf ' + jar + ' client.class')
        os.popen('jad client.class')
        os.remove('client.class')
        print 'Extracted and decompiled client.class using JAD.'
    except Exception, e:
        print 'Ran into an error:', str(e)

def getVersion():
    try:
        f = open('client.jad')
        for line in f:
            if re.match('(.*)(client1.a)(.*)', line):
                restring = re.compile('5([0-9][0-9])')
                match = restring.search(line)

                if match:
                    print 'Current version:', '5' + match.group(1)
        f.close()
        os.remove('client.jad')
    except Exception, e:
        print 'Ran into an error:', str(e)

print 'Attempting to get version of the runescape client\'s .jar'
decomClass(str(raw_input('Jar name (with extension): ')))
